import { useState } from "react";
import './Education.css';

function Subject(props){
    return (
        <div class='subject' style='backgroudcolor:{props.color}'></div>
    );
}

function Education(){
    return (
        <div>
            <Subject color='blue'></Subject>
            <Subject ></Subject>
            <Subject></Subject>
            <Subject></Subject>
            <Subject></Subject>
            <Subject></Subject>
        </div>
    );
}

export default Education;
